import React from 'react';
import "../components/freefire.css";

const cardData = [
  'freefire-card-1',
  'freefire-card-2',
  'freefire-card-3',
  'freefire-card-4',
];

function Freefire() {
  return (
    <>
      <div className="card-container">
        {cardData.map((cardClass, index) => (
          <div key={index} className={cardClass}></div>
        ))}
      </div>
    </>
  );
}

export default Freefire;
